import React from 'react';
import ReactDOM from 'react-dom';
import './css/App.css';
import App from './js/components/App';
import * as serviceWorker from './js/serviceWorker';

const app = document.getElementById('root');

ReactDOM.render(
    <App />, 
app);

serviceWorker.unregister();
